  \"2015-02-04T19:07:04.819787\",\n\t\"name\": \"school-safety-report-8067a\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Since 1998, the New York City Police Department
  (NYPD) has been tasked with the collection and maintenance of crime data for incidents
  that occur in New York City public schools. The NYPD has provided this data for
  the 2010-2011 school year to the New York City Department of Education (DOE), covering
  the period from July 1, 2010-June 30, 2011. The DOE has compiled this data by schools
  and locations for the information of our parents and students, our teachers and
  staff, and the general public. rnIn some instances, several Department of Education
  learning communities co-exist within a single building. In other instances, a single
  school has locations in several different buildings. In either of these instances,
  the data presented here is aggregated by building location rather than by school,
  since safety is always a building-wide issue. We use u201cconsolidated locationsu201d
  throughout the presentation of the data to indicate the numbers of incidents in
  buildings that include more than one learning community.\",\n\t\"license_title\":
